import './index.css';
import React from 'react';
import ReactDOM from 'react-dom';

const BookList=()=>{
    return (

        <article className="booklist">

        </article>
)
};
const title = 'Harry potter and the soccesser stone';
const author = 'JK Rowling'
const Book=()=>{
return (
<article className='book'>
    <img src="https://www.amazon.com/Harry-Potter-Sorcerers-Stone-Book/dp/B017V4IMVQ/ref=sr_1_2?crid=29XK5QIAD53SQ&keywords=harry+potter+books&qid=1696476577&sprefix=harry%2Caps%2C308&sr=8-2" alt="book" style={{width:'200px',height:'200px'}} />
    <h1>{title}</h1>
    <h3><i>{author}</i></h3>
</article>
)
};
const Title=()=>{
    return <h3>Harry potter and the soccesser stone</h3>
};

const Author=()=>{
    return <h4><i>JK Rowling</i></h4>
};

const Image=()=>{
return <img src="https://www.amazon.com/Harry-Potter-Sorcerers-Stone-Book/dp/B017V4IMVQ/ref=sr_1_2?crid=29XK5QIAD53SQ&keywords=harry+potter+books&qid=1696476577&sprefix=harry%2Caps%2C308&sr=8-2" alt="book" style={{width: '200px', height: '200px'}} />
};



ReactDOM.render(<BookList/>, document.getElementById('root'));
